import{_ as e,o as t,c as r,O as o}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 24.2-1009 Stealing or tampering with ballot containers, voting or registration equipment, software, records or documents.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-1009.md","filePath":"vacode/24.2-1009.md"}'),i={name:"vacode/24.2-1009.md"},a=o('<h1 id="§-24-2-1009-stealing-or-tampering-with-ballot-containers-voting-or-registration-equipment-software-records-or-documents" tabindex="-1">§ 24.2-1009 Stealing or tampering with ballot containers, voting or registration equipment, software, records or documents. <a class="header-anchor" href="#§-24-2-1009-stealing-or-tampering-with-ballot-containers-voting-or-registration-equipment-software-records-or-documents" aria-label="Permalink to &quot;§ 24.2-1009 Stealing or tampering with ballot containers, voting or registration equipment, software, records or documents.&quot;">​</a></h1><p>Any person who (i) steals or willfully, fraudulently, or wrongfully tampers with any part of any ballot container, voting or registration equipment, records, or documents, which are used in any way within the registration or election process, (ii) steals or willfully, fraudulently, or wrongfully tampers with the software used to prepare and operate voting equipment or the software or hardware used to collect and disseminate election returns, (iii) steals or willfully, fraudulently, or wrongfully tampers with an electronic activation device or electronic data storage medium of the type used to prepare, operate or back-up electronic voting equipment, (iv) willfully, fraudulently, or wrongfully intercepts, alters or disrupts the electronic transmission of election returns or the posting of returns on the Internet, (v) fraudulently makes any entry, deletion, or alteration to any item listed in (i), or (vi) aids, abets, or permits any other person to violate the provisions of clauses (i) through (v), shall be guilty of a Class 5 felony.</p><p>Code 1950, §§ 24-318, 24-404; 1952, c. 4; 1970, c. 462, §§ 24.1-273, 24.1-275; 1981, c. 425; 1991, c. 710; 1993, c. 641; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1015" target="_blank" rel="noreferrer">1015</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0993" target="_blank" rel="noreferrer">993</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP1010" target="_blank" rel="noreferrer">1010</a>.</p>',3),n=[a];function l(s,c,u,p,d,g){return t(),r("div",null,n)}const m=e(i,[["render",l]]);export{h as __pageData,m as default};
